      }
      // Add more top-level menu items here
      ]
    };
  },
  components: {
    Navbar,
    simplebar,
    pageheader,
    // MenuComponents
    Rightbar,
    FooterComponents
  },
  methods: {
    changeLayoutType(layoutType) {
      // Update the layout type in the store
      this.$store.commit('changeLayoutType', {
        layoutType
      });

      // Set the layout attribute based on the layout type
      document.body.setAttribute('data-pc-layout', layoutType);
    },
    handleOutsideClick(event) {
      if (this.$store.state.isMobileSidebarActive && !this.$el.contains(event.target)) {
        // Close the mobile sidebar
        this.$store.commit('toggleMobileSidebar');
      }
    }
  },
  watch: {
    layoutType: {
      immediate: true,
      deep: true,
      handler(newVal, oldVal) {
        if (newVal !== oldVal) {
          switch (newVal) {
            case "horizontal":
              document.body.setAttribute("data-pc-layout", "horizontal");
              break;
            case "vertical":
              document.body.setAttribute("data-pc-layout", "vertical");
          }
        }
      }
    }
  },
  computed: {
    // ...layoutComputed,
    layoutType: {
      get() {
        return this.$store.state.layout.layoutType;
      },
      set(layoutType) {
        this.$store.commit('changeLayoutType', {
          layoutType
        });
      }
    },
    isFixedWidth() {
      return this.$store.getters.isFixedWidth;
    }
  },
  mounted() {}
};
